import React, { Component } from 'react'
import './MainPage.css'

export default class MainPage extends Component {
	render() {
		return (
			<div className='background'>
				<div className='container'>
					<button className="btn btn-outline btn-success">GAME START</button>
					<button className="btn btn-outline btn-warning">MY PROFILE</button>
					<button className="btn btn-outline btn-error">LEADERBOARD</button>
				</div>
				<div className="drawer drawer-end">
					<input id="my-drawer-4" type="checkbox" className="drawer-toggle" />
					<div className="drawer-content">
						{/* Page content here */}
						<label htmlFor="my-drawer-4" className="drawer-button btn btn-primary">MY CHAT<br></br>◀︎</label>
					</div> 
					<div className="drawer-side">
						<label htmlFor="my-drawer-4" className="drawer-overlay"></label>
						<ul className="menu p-4 w-80 h-full bg-base-200 text-base-content">
						{/* Sidebar content here */}
						<li><a className='chat_btn'>daechoi's chat</a><a className='chat_member_count'>10/25</a></li>
						<li><a className='chat_btn'>sdnfldsa's chat</a><a className='chat_member_count'>8/25</a></li>
						</ul>
					</div>
				</div>
			</div>
		);
	}
}
